import React from "react";
import "./WomensFashionPage.css";

const WomensFashionPage = () => {
  const womensItems = [
    {
      id: 1,
      title: "Women's Dresses",
      description: "Elegant dresses for all occasions.",
      image:
        "https://rukminim2.flixcart.com/image/612/612/xif0q/t-shirt/g/u/p/l-round-neck-t-shirt-zilcon-original-imagsuyndp8tata3.jpeg?q=70",
    },
    {
      id: 2,
      title: "Women's Handbags",
      description: "Stylish handbags for every outfit.",
      image:
        "https://rukminim2.flixcart.com/image/612/612/xif0q/hand-messenger-bag/e/u/b/women-girl-shoulder-bag-40-women-shoulder-bag-hobo-hidle-berg-29-original-imah6ugy2zyufuye.jpeg?q=70",
    },
    {
      id: 3,
      title: "Women's Heels",
      description: "Trendy high heels for a fashionable look.",
      price: "$60",
      image:
        "",
    },
    {
      id: 4,
      title: "Jewelry Sets",
      description: "Beautiful jewelry to elevate your style.",
      price: "$150",
      image:
        "https://via.placeholder.com/300x300?text=Jewelry+Sets",
    },
    {
      id: 5,
      title: "Women's Sunglasses",
      description: "Trendy sunglasses for all seasons.",
      price: "$40",
      image:
        "https://via.placeholder.com/300x300?text=Women's+Sunglasses",
    },
    {
      id: 6,
      title: "Women's Perfume",
      description: "Exquisite fragrances for women.",
      price: "$70",
      image:
        "https://via.placeholder.com/300x300?text=Women's+Perfume",
    },
    {
      id: 7,
      title: "Women's Jackets",
      description: "Stylish jackets for winter wear.",
      price: "$90",
      image:
        "https://via.placeholder.com/300x300?text=Women's+Jackets",
    },
    {
      id: 8,
      title: "Women's Scarves",
      description: "Fashionable scarves for a chic look.",
      price: "$30",
      image:
        "https://via.placeholder.com/300x300?text=Women's+Scarves",
    },
  ];

  return (
    <div className="womens-fashion-page">
      <h1>Women's Fashion</h1>
      <div className="womens-grid">
        {womensItems.map((item) => (
          <div className="womens-card" key={item.id}>
            <img src={item.image} alt={item.title} />
            <div className="womens-details">
              <h2>{item.title}</h2>
              <p>{item.description}</p>
              <span>{item.price}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default WomensFashionPage;
